// src/App.js
import React from 'react';
import './App.css';
import ProfileList from './components/ProfileList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My App</h1>
      </header>
      <ProfileList />
    </div>
  );
}

export default App;

